import React from "react";
//import { NavLink, Link, useNavigation } from "react-router-dom";
import "./Home.css";

export const Home = () => {
  return (
    <div className="main-container">
      <div className="sideBar">
        <img
          src={require("../../images/burger_menu.png")}
          className="menuimg"
          alt="menu"
        />
        <img
          src={require("../../images/home_inc.png")}
          className="homeimg"
          alt="home"
        />
      </div>
      <div className="side-conatiner">
        <div className="tabBar">
          <img
            src={require("../../images/logo2.png")}
            className="logoimage"
            alt="logo"
          />
          <div className="divboxcontainer">
            <img
              src={require("../../images/sync1.png")}
              alt="sync"
              className="syncimg"
            />

            <img
              src={require("../../images/profile1.png")}
              alt="profile"
              className="profileimg"
            />
          </div>
        </div>
        <div className="viewContainer">fdsfsdfsdfs</div>
      </div>
    </div>
  );
};
